    true,nt"url": null,nt"notes": "The Chief Human Capital Officers developed
    3 surveys that asks applicants to assess their satisfaction with the application
    process on a 1-10 point scale, with 10 representing the highest level of satisfaction.
     There is a completer survey sent to a randomly selected 50 percent sample of USAJOBS
    applicants who complete and submit their application.  Of all those who take the
    completer survey, they are also asked to participate in a post-completer survey.
     There is also an abandoner survey for USAJOBS applicants who do not complete the
    USAJOBS application.",nt"license_title": "U.S. Government Work",nt"extras":
